import React from 'react';
import image from '../Img/pngwing.com.png';

function Home() {
  return (
    <div style={styles.container}>
      <div style={styles.content}>
        <div style={styles.header}>
          <b>Doctor</b> <br />
          <span>Consultation</span>
        </div>
        <div style={styles.description}>
          <p>We are here to serve you, and heal you <br /> All are welcome.</p>
        </div>
      </div>
      <div style={styles.imageContainer}>
        <img src={image} style={styles.image} alt="Doctor Consultation"/>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '20px',
    alignItems: 'center', // This ensures vertical alignment
    height: '100vh', // Takes full height of the viewport
  },
  content: {
    flex: 1,
    marginRight: '20px', // Adds spacing between content and image
  },
  header: {
    fontSize: '2rem',
    color: '#2a2a72', 
    marginBottom: '10px', 
  },
  description: {
    fontSize: '1.2rem',
    lineHeight: '1.5', 
  },
  imageContainer: {
    flex: 1, 
    display: 'flex',
    justifyContent: 'center', 
  },
  image: {
    maxHeight: '600px',
    maxWidth: '100%', 
    objectFit: 'contain', 
  }
};

export default Home;
